    Democratic Party Victory Fund; a joint fundraising committee with the Democratic
    National Committee and the Massachusetts Democratic Party.   The receipt from
    the SEIU Mass State Council for $10,000 is for the purchase of the MDP voter file
    at the usual and normal charge.  The receipt from 'Massachusetts Democratic Party/G&S'
    was an internal bank transfer and should not have been listed as a receipt.  It
    has been deleted from this amendment.  Additional employers and occupations are
    reported in this amendment."
